  false,\n\t\"url\": null,\n\t\"notes\": \"Overall, the vegetation planting in Big
  Branch National Wildlife Refuge was ancomplete success. The project site now contains
  greater than 50% vegetative cover of S. alterniflora andnS. patens and vertical
  accretion was shown to reach 1 cm., capable of off setting relative sea-level risen(RSLR).
  Percent cover of these two species is expected to continue to increase given that
  verticalnaccretion continues to outpace subsidence, sediment elevations meet the
  requirements of thenaforementioned species and herbivory is kept in check. To ensure
  continued project success, vegetativencover, elevation change, and herbivore impacts
  should be periodically monitored in the future.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
